    try {
      const res = await fetch(url);
      const data = await res.json();
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    fetchApiData(API);
  }, []);

  return (
    <>
      <h1>My Tech News</h1>
    </>
  );
};

export default Stories;
